import React, { useState, useEffect } from "react";
import axios from "axios";
import "./timeline.css";

import batmanYearOne from "../images/postImages/batman-yearOne.jpg";
import batmanManWhoLaughs from "../images/postImages/batman-theManWhoLaughs.jpg";
import batmanZeroYear from "../images/postImages/batman-zeroYear.jpg";
import Cover from "./Cover";

function Timeline(props) {
  const url = "http://localhost:1337/events";

  const apiResponse = props;

  const coverColumn = Object.keys(apiResponse).map(key => 
    <ul>
      <Cover
        coverImage={apiResponse[key].cover}
        id={apiResponse[key].id}
        alternatve={apiResponse[key].slug}
      />
    </ul>
  );

  console.log(apiResponse[0].id);

  return (
    <div className="parent">
      <div className="covercolumn">
        <div>{coverColumn}</div>
      </div>
    </div>
  );
}

export default Timeline;
